import { useState } from 'react';

export const ToDo = () => {
	const [tasks, setTasks] = useState([]);
	const [input, setInput] = useState('');

	const addTask = () => {
		if (input.trim() === '') return;
		const newTask = {id: Date.now(), text :input, status: 'todo'}
		setTasks([...tasks, newTask]);
		setInput('');
	}

  return (
    <div>
    	<h1>ToDo list</h1>


	</div>
  )
}
